import React from 'react';

import Typography from '@mui/material/Typography';
import Paper from '@mui/material/Paper';

// MATERIAL UI ICONS
import SupervisedUserCircleIcon from '@mui/icons-material/SupervisedUserCircle';

function WhoAreWe() {
  return (
    <Paper
      id="who-are-we"
      sx={{
        width: '70%',
        maxWidth: '800px',
        margin: '0 auto',
        position: 'relative',
        top: '-4rem',
        padding: '2rem',
      }}
    >
      <SupervisedUserCircleIcon color="primary" fontSize="large" sx={{ textAlign: 'center' }} />
      <Typography align="center" variant="h4"> Qui sommes-nous ? </Typography>
    </Paper>
  );
}

export default WhoAreWe;
